<p>Dans le souci de rpondre aux besoins en ressources humaines et scientifiques qualifies, un groupe d'intellectuels et hommes d'affaires burundais s'est mobilis pour crer l'East African Leadership Institute (EALI en sigle). Ce dernier a eu l'autorisation de dmarrer ses activits suite  l'Ordonnance Ministrielle n610/1760 du 19 septembre 2016. Cette ide est largement partage par les responsables administratifs des provinces de la rgion nord du Burundi. EALI a t cr sous le couvert de l'Association Sans But Lucratif (ASBL) dnomm Centre Rgional pour la Formation et le Dveloppement Intgr (CRFDI) qui a t agr par Ordonnance Ministrielle n530/391 du 16 mars 2015 par le Ministre de l'Intrieur.</p>

