<p>A l'issue de la formation de trois annes pour les facults et deux ans pour l'Institut, EALI est autoris  dlivrer respectivement le Diplme de niveau Baccalaurat et le Diplme d'Enseignement Suprieur Professionnel (DESP).</p>

